function Header() {
    return (
        <header className="header">
            <div class="container">
                <h1 class="title">Mavel's Fearless</h1>
            </div>
            <style jsx>
                {`
                .header {
  width: 100%;
  height: 100vh;
  padding-top: 15rem;
  padding-bottom: 5rem;
  color: var(--color-secondary);
  background-color: var(--color-primary);
  position: relative;
}

.title,
.subtitle {
  width: 60rem;
  max-width: 100%;
}

.title {
  font-size: 7.2rem;
}

.subtitle {
  margin-bottom: 3rem;
}
`}
           </style>
        </header>
    )
}
export default Header;
